import React, { Component, state } from "react";
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon } from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';

import { useContext } from 'react';
import UserContext from './../context/UserContext';

function Navbar() {

const { userData, setUserData } = useContext(UserContext);

state = {
  isOpen: false
};

const logout = () => {
    localStorage.removeItem('auth-token');
    setUserData({
        token: null,
        user: null
    });
}

const toggleCollapse = () => {
  this.setState({ isOpen: !this.state.isOpen });
}

// render() {
    return (
        <Router>
        <MDBNavbar color="grey lighten-1" dark expand="md">
            <MDBNavbarBrand>
                <strong className="grey-text">Widget_Stic</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={this.toggleCollapse} />
            <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
            <MDBNavbarNav left>
            {
                userData.user ? (
                <>
                <MDBNavItem active>
                    <MDBNavLink to="#!">Login</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                    <MDBNavLink to="#!">Register</MDBNavLink>
                </MDBNavItem>
                </>
                ) : (
                <>
                <MDBNavItem active>
                    <MDBNavLink to="#!" onClick={logout}>Logout</MDBNavLink>
                </MDBNavItem>
                <MDBNavItem>
                    <MDBNavLink to="#!">Profile</MDBNavLink>
                </MDBNavItem>
                </>
                )}
            </MDBNavbarNav>
            </MDBCollapse>
        </MDBNavbar>
        </Router>
        );
}


export default Navbar;
